    /**
     * 生成密钥，公钥和私钥
     */
    @Test
    public void createKeyPairs() {
        try {
            System.out.println("==============RSA密钥================");

            Security.addProvider(new BouncyCastleProvider());

            //KeyPairGenerator类用于生成公钥和私钥对，基于RSA算法生成对象
            KeyPairGenerator generator = KeyPairGenerator.getInstance("RSA", "BC");

            // 初始化密钥对生成器，密钥大小为96-1024位
            generator.initialize(512, new SecureRandom());

            //生成一个密钥对，保存在keyPair中
            KeyPair pair = generator.generateKeyPair();

            // 得到私钥
            PublicKey pubKey = pair.getPublic();

            // 得到公钥
            PrivateKey privKey = pair.getPrivate();

            byte[] pk = pubKey.getEncoded();
            byte[] privk = privKey.getEncoded();

            // 得到公钥字符串
            String strpk = new String(Base64.encodeBase64(pk));

            // 得到私钥字符串
            String strprivk = new String(Base64.encodeBase64(privk));

            System.out.println("公钥Base64编码:" + strpk);
            System.out.println("私钥Base64编码:" + strprivk);


//            String strprivk = new String(Hex.encodeHex(privk));
//            String strpk = new String(Hex.encodeHex(pk));
//            System.out.println("公钥Hex编码:" + strpk);
//            System.out.println("私钥Hex编码:" + strprivk);
        } catch (Exception e) {
            e.printStackTrace();
        }
    }


    @Test
    public void testRsa() {
        try {

            System.out.println("==============RSA解密================");


            Security.addProvider(new BouncyCastleProvider());

            //公钥
            String strpk = "MFwwDQYJKoZIhvcNAQEBBQADSwAwSAJBAIjMtjovGC+QAYLEhGBmxLCSLxMjBAoKduZJao+kRSR5Hj1m/W+rSnN1XhQcA6Vij8pqcMzZ4NVrapG0pxj/rH8CAwEAAQ==";

            //私钥
            String strprivk = "";

            //加载公钥
            X509EncodedKeySpec pubX509 = new X509EncodedKeySpec(Base64.decodeBase64(strpk.getBytes()));
            //加载私钥
            PKCS8EncodedKeySpec priPKCS8 = new PKCS8EncodedKeySpec(Base64.decodeBase64(strprivk.getBytes()));

            KeyFactory keyf = KeyFactory.getInstance("RSA", "BC");

            PublicKey pubKey = keyf.generatePublic(pubX509);

            PrivateKey privKey = keyf.generatePrivate(priPKCS8);

            RsaUtil rsaUtil = new RsaUtil();
            String data = "luoguohui";
            System.out.println("加密前字符串：data=" + data);
            String encryptData = null;
            if (pubKey != null && (data != null && !data.equals(""))) {
                encryptData = rsaUtil.encryptData(data, pubKey);
                System.out.println("加密后字符串：encryptData=" + encryptData + ";length:" + encryptData.length());
            }
            String descryptData = null;
            if (privKey != null && (encryptData != null && !encryptData.equals(""))) {
                descryptData = rsaUtil.decryptData(encryptData, privKey);
                System.out.println("解密后字符串：descryptData=" + descryptData);
            }
        } catch (Exception e) {
            e.printStackTrace();
        }
    }


    @Test
    public void sha1Test() {
        System.out.println("==============sha1================");
        String str = "zhangjianbin";
        String result = DigestUtils.sha1Hex(str);
        String key = DigestUtils.md5Hex(result);
        System.out.println(result + " length:" + result.length());

        System.out.println(key + " length:" + key.length());

    }


    /**
     * 密钥: fa1613843104922ffc375d447d410b44
     * length: 32
     * 解密： zhangjianbin
     */
    @Test
    public void aseTest2() {
        //language=JSON
        String zhangjianbin = "[{\"platformId\":2,\"createDate\":\"2018-09-12 12:23:30\",\"produceLine\":\"b2b\",\"version\":\"v1\",\"passpord\":\"jd\"}]";
        String str = zhangjianbin;

        String password = "jd";

        //数据 base64
        String content = Base64.encodeBase64String(zhangjianbin.getBytes());

        //ASE 加密
        byte[] encrypt = encrypt(content, password);

        // ASE 加密 再转为 base64
        String value = Base64.encodeBase64String(encrypt);
        System.out.println("密钥: " + value + " length: " + value.length());


        //先base64再ASE解密，再bas464解密
        byte[] decrypt = Base64.decodeBase64(decrypt(Base64.decodeBase64(value), password));
        System.out.println("解密： " + new String(decrypt));

    }

